@Regrann from @wacommunity -  A giant timber canopy by @mecanoo_ covers the world's famous #gardens at Keukenhof in Netherlands by creating impressive shadow-light effect between two volumes. This striking timber roof leans on two volumes, forming an impressive gateway to the park. 
This porous installation built from the stepped roof structure of interwoven isosceles triangles-which provides a shelter-and it creates an ever-changing play of light and shadow.

